import React from 'react';

function AboutHeroSection() {
  const sectionStyle = {
    backgroundImage: `url(/images/hero-background.jpg)`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  };
  return (
    <section style={sectionStyle} className='hero-section-secondary'>
      <h2 className='hero-section-secondary__title'>O epoxide</h2>
      <div className='hero-section-secondary__text'>
        <p>Hlavná stránka</p>
        <p className='hero-section-secondary__text-accent'>O epoxide</p>
      </div>
    </section>
  );
}
export default AboutHeroSection;
